package org.jn.core.java.student.mirza.baig.relational.operator;

public class NumGreater {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		int num1 =20;
		int num2=40;
		
		System.out.println(num1 > num2);
		System.out.println(num1 >=num2);
		System.out.println(num1 < num2);
		System.out.println(num1 <= num2);
		System.out.println(num1 == num2);
		System.out.println(num1 != num2);
		
		
		  
		
	}

}

